import React from 'react';

import { Wrapper, ResultsHeader } from './ProgramContainer.styles';
import ProgramRow from '../ProgramRow/ProgramRow';

const renderPrograms = programs => {
  return programs.map(program => <ProgramRow program={program} />);
};

const renderHeader = (term, count) =>
  term ? (
    <ResultsHeader>{`${count} programs found for ${term}!`}</ResultsHeader>
  ) : (
    <ResultsHeader>{`${count} programs found!`}</ResultsHeader>
  );

const ProgramContainer = (count, term, programs) => (
  <Wrapper>
    {renderHeader(count, term)}
    {renderPrograms(programs)}
  </Wrapper>
);

export default ProgramContainer;
